    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge summarizes refuge activities from May through August of
    1961.  The report begins with general information about the yearu2019s weather and
    habitat conditions.  Wildlife- including migratory birds, upland game birds, big
    game animals, fur animals, predators, rodents, other mammals, predaceous birds,
    fish, reptiles, and disease- is also covered.  The report includes a refuge development
    and maintenance section which discusses physical developments, plantings, collections
    and receipts, control of vegetation, planned burning, and fires.  Resource management
    is outlined; haying and special use permits were the primary resources.  A progress
    report on field investigations and waterfowl banding is also included.  The public
    relations section of the report discusses recreational uses of the refuge, refuge
    visitors, refuge participation, hunting, and violations.  Finally, items of interest,
    photographs, and N-R forms are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
